import shopData from "./ShopData";
import {actionsTypes} from "./actionTypes";
const InitialState = { collections:shopData}
const shopReducer = (state = InitialState, action) => {
    switch (action.type) {
        case actionsTypes.
        default:
            return state
    }
}
export default shopReducer;
